import React, { Component } from 'react'
import {
    NavLink,
    withRouter
} from 'react-router-dom';
import Logo from "../images/plant.svg"

class Footer extends Component {

	render() {
		return (
			<div className="ui borderless main menu">
				<div className="ui text container">
					<div className="item"><img className="svg" src={Logo}/></div>
					<div href="#" className="item"><strong>Plant Pals</strong></div>
					<a className="item"><NavLink to="/home">My Plants</NavLink></a>
					<div className="ui right floated item"><strong>Hello {this.state ? this.state.user.name : null}</strong></div>
					<a className="ui item" ><NavLink to="/login">Login</NavLink></a>
					<a className="ui item" onClick={this.logout}><NavLink to="/login">Logout</NavLink></a>
				</div>
			</div>
		)
	}
}

export default withRouter(Footer)
